import { Major, Ticket } from '../models/ticket';
import { STUDENTS_MOCKED } from './student.mock';

const dateToday: Date = new Date();

export const TICKETS_MOCKED: Ticket[] = [
  {
    "title": 'Alger',
    "description": 'Alger!',
    "date": dateToday,
    "student": STUDENTS_MOCKED[0],
    "major": Major.SI,
    "archived": false
  },
  {
    "title": 'TIZI',
    "description": 'Component',
    "date": dateToday,
    "student": STUDENTS_MOCKED[1],
    "major": Major.GE,
    "archived": false
  },
  {
    "title": 'AIR  France',
    "description": 'hello',
    "date": dateToday,
    "student": STUDENTS_MOCKED[3],
    "major": Major.AI,
    "archived": false
  },
];
